import Routes from "./Routes";
import { Helmet } from "react-helmet";

function App() {
  return (
    <div className="App">
      <Helmet>
        <title>I'm HERE - 나 여기야</title>
        {/* <link rel="icon" href={}/> */}
      </Helmet>
      <Routes />
    </div>
  );
}

export default App;
